function calcAngle(lat1, long1, lat2, long2){
    dLon = long2-long1;
    y = Math.sin(dLon)*Math.cos(lat2);
    x = Math.cos(lat1)*Math.sin(lat2) - Math.sin(lat1)*Math.cos(lat2)*Math.cos(dLon);
    ang = Math.atan2(y,x);
    var pi = Math.PI;
    ang = ang * (180/pi);
    ang = (ang+360)%360;
    ang = 360-ang;
    return ang;
}

markerLayer1 = L.layerGroup();
markerLayer2 = L.layerGroup();
let s = "<div id='html_f4caae7f093065b807e97d77b0a32dd6' style='width: 100.0%; height: 100.0%;'>TextInfo</div>";
var i=0;
// var icao_list = {};
async function renderplane(){
    i+=1;
    a = i%2? markerLayer1 : markerLayer2;
    b = i%2? markerLayer2 : markerLayer1;
    const response = await fetch('./data.json?nocache='+(new Date()).getTime());
    var data = await response.json();
    for (let i = 0; i < data["icaos"].length; i++){
        if(data["icaos"][i] in data["location"] && data["icaos"][i] in data["validity"] && data["validity"][data["icaos"][i]][0]===true){
            if(data["icaos"][i] in data["icaos_first_location"]){
                ang=calcAngle(data["icaos_first_location"][data["icaos"][i]][0],
                            data["icaos_first_location"][data["icaos"][i]][1],
                            data["location"][data["icaos"][i]][0],
                            data["location"][data["icaos"][i]][1]);
                var marker = L.marker(
                    data["location"][data["icaos"][i]],
                    {rotationAngle: ang,
                    rotationOrigin: 'center'}
                ).addTo(a);
                // var poly_line = L.polyline(
                //     [data["icaos_previous_location"][data["icaos"][i]],data["location"][data["icaos"][i]]],
                //     {"color": "blue", "dashArray": "5", "dashOffset": null, "lineCap": "round", "lineJoin": "round", "noClip": false, "opacity": 0.8, "smoothFactor": 1.0, "stroke": true, "weight": 2}
                // ).addTo(map_);
            }
            else{
                var marker = L.marker(
                    data["location"][data["icaos"][i]],
                    {}
                ).addTo(a);
                //icao_list[data["icaos"][i]]=data["location"][data["icaos"][i]];
            }
            marker.setIcon(icon_red_plane);
        }
        var popup = L.popup({"maxWidth": "100%"});
        popup.setContent(s.replace("TextInfo", data["icaos"][i]));
        marker.bindPopup(popup);
    }
    a.addTo(map_);
    map_.removeLayer(b);
    b.clearLayers();
}
